import React from 'react';
import './Turismo.css'; // Crie um arquivo CSS se necessário

function Turismo() {
    return (
        <div className="turismo-page">
            <h1>Turismo</h1>
            <p>Conteúdo provisório para a página de turismo.</p>
        </div>
    );
}

export default Turismo;
